import { isAuthenticated } from "../services/Auth";
import "./NavBar.css";
import * as React from "react";
import PropTypes from "prop-types";
import {AppBar,Box,CssBaseline,Divider,Drawer,IconButton,List,ListItem,ListItemButton,ListItemText,Toolbar,Typography,Button} from "@mui/material";
import MenuIcon from "@mui/icons-material/Menu";

const drawerWidth = 240;

export default function NavBar(props) {
  const { window } = props;
  const [mobileOpen, setMobileOpen] = React.useState(false);
  const handleDrawerToggle = () => {
    setMobileOpen((prevState) => !prevState);
  };

  const drawer = (
    <Box onClick={handleDrawerToggle} sx={{ textAlign: "center" }}>
      <Link className="navbar-brand" href="#home" style={{ textDecoration: "none" }}>
        <Typography variant="h6" sx={{ my: 2 }} >
          User Authenticator
        </Typography>
      </Link>
      {/* <a  className="navbar-brand" href="#" ><h6>User Authenticator</h6></a> */}

      <Divider />
      <List style={{ color: "black" }}>
        {!isAuthenticated() ? (
          <ListItem disablePadding>
            <ListItemButton sx={{ textAlign: "center" }}>
              <ListItemText>
                <Link className="nav-link" to="/"style={{color:"black"}} >
                  Register
                </Link>
              </ListItemText>
            </ListItemButton>
          </ListItem>
        ) : null}
        {!isAuthenticated() ? (
          <ListItem disablePadding>
            <ListItemButton sx={{ textAlign: "center" }}>
              <ListItemText>
                <Link className="nav-link" to="/login" >
                  Loginstyle={{color:"black"}}
                </Link>
              </ListItemText>
            </ListItemButton>
          </ListItem>
        ) : null}
        {isAuthenticated() ? (
          <ListItem disablePadding>
            <ListItemButton sx={{ textAlign: "center" }}>
              <ListItemText>
                <Link className="nav-link" to="/dashboard"style={{color:"black"}} >
                  Dashboard
                </Link>
              </ListItemText>
            </ListItemButton>
          </ListItem>
        ) : null}
        {isAuthenticated() ? (
          <ListItem disablePadding>
            <ListItemButton sx={{ textAlign: "center" }}>
              <ListItemText>
                <Link href="#logout"
                  className="nav-link"
                  onClick={props.logoutUser}
                  style={{ cursor: "pointer",color:"black" }}
                >
                  Logout
                </Link>
              </ListItemText>
            </ListItemButton>
          </ListItem>
        ) : null}
      </List>
    </Box>
  );

  const container =
    window !== undefined ? () => window().document.body : undefined;

  return (
    <div>
      {/* <Box sx={{ display: "flex" }}>
